function rediHome() {
    window.location.href = "/"
}
function rediLogin() {
    window.location.href = "/login"
}
function rediGT() {
    window.location.href = "/games/topics"
}
function rediU(n) {
    window.location.href = `/user-file/${n}`
}
function rediSF(n) {
    window.location.href = `/share-file/${n}`
}
function rediTutorial(n, t) {
    window.location.href = `/games/tutorials?slug=${n}&level=${t}`
}
function rediTestConfig(n, t) {
    window.location.href = `/Exercise/Config/${n}/${t}`
}
function rediDoEx(n, t) {
    window.location.href = `/Exercise/Do-Exercise-5/${n}/${t}`
}
function rediDiaU(n) {
    window.location.href = `/update-user/${n}`
}
function openMn(n, t) {
    t ? ($("#mnList").removeClass("d-none"),
    $("#mnList").addClass("d-block"),
    $("#homeIcon").addClass("d-none"),
    $("#cancelIcon").removeClass("d-none"),
    $(`#${n}`).addClass("d-none")) : ($("#mnList").addClass("d-none"),
    $("#mnList").removeClass("d-block"),
    $("#homeIcon").removeClass("d-none"),
    $("#cancelIcon").addClass("d-none"),
    $(`#${n}`).removeClass("d-none"))
}
